def login_required_and_check_session(variable_name, expected_value):
    def decorator(view_func):
        @login_required
        def _wrapped_view(request, *args, **kwargs):
            # Verificar si la variable de sesin tiene el valor esperado
            if request.session.get(variable_name) != expected_value:
                return HttpResponseForbidden("No tienes permisos para acceder a esta pgina.")
            return view_func(request, *args, **kwargs)
        return _wrapped_view
    return decorator

